package com.example.propert_app.model;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;import java.util.List;public class PropertyDetailModel {    @SerializedName("status")    @Expose    public Integer status;    @SerializedName("message")    @Expose    public String message;    @SerializedName("data")    @Expose    public Data data;    public PropertyDetailModel(Integer status, String message, Data data) {        super();        this.status = status;        this.message = message;        this.data = data;    }    public class Attachment {        @SerializedName("attachment")        @Expose        public String attachment;        /**         * No args constructor for use in serialization         */        public Attachment() {        }        /**         * @param attachment         */        public Attachment(String attachment) {            super();            this.attachment = attachment;        }    }    public class Data {        @SerializedName("property")        @Expose        public Property property;        /**         * No args constructor for use in serialization         */        public Data() {        }        /**         * @param property         */        public Data(Property property) {            super();            this.property = property;        }    }    public class Property {        @SerializedName("id")        @Expose        public Integer id;        @SerializedName("name")        @Expose        public String name;        @SerializedName("bedroom")        @Expose        public String bedroom;        @SerializedName("bathroom")        @Expose        public String bathroom;        @SerializedName("location")        @Expose        public String location;        @SerializedName("description")        @Expose        public String description;        @SerializedName("featuers")        @Expose        public String featuers;        @SerializedName("post_type")        @Expose        public String postType;        @SerializedName("electrical_watt")        @Expose        public Integer electricalWatt;        @SerializedName("property_type")        @Expose        public String propertyType;        @SerializedName("price")        @Expose        public String price;        @SerializedName("square_area")        @Expose        public String squareArea;        @SerializedName("attachments")        @Expose        public List<Attachment> attachments = null;        /**         * No args constructor for use in serialization         */        public Property() {        }        /**         * @param attachments         * @param postType         * @param squareArea         * @param electricalWatt         * @param description         * @param bedroom         * @param featuers         * @param price         * @param propertyType         * @param name         * @param location         * @param id         * @param bathroom         */        public Property(Integer id, String name, String bedroom, String bathroom, String location, String description, String featuers, String postType, Integer electricalWatt, String propertyType, String price, String squareArea, List<Attachment> attachments) {            super();            this.id = id;            this.name = name;            this.bedroom = bedroom;            this.bathroom = bathroom;            this.location = location;            this.description = description;            this.featuers = featuers;            this.postType = postType;            this.electricalWatt = electricalWatt;            this.propertyType = propertyType;            this.price = price;            this.squareArea = squareArea;            this.attachments = attachments;        }    }}